import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { login } from "../actions/userActions";
import { Navigate, Link } from "react-router-dom";

export default function LoginScreen() {
  const dispatch = useDispatch();
  const { userInfo, loading, error } = useSelector((s) => s.userLogin);
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const submit = (e) => { e.preventDefault(); dispatch(login(username, password)); };
  if (userInfo?.access) return <Navigate to="/" />;

  return (
    <div className="min-vh-100 d-flex align-items-center justify-content-center animate-fade-in" style={{ background: 'var(--primary-gradient)' }}>
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-lg-5 col-md-7">
            <div className="card border-0 shadow-lg animate-scale-in" style={{
              borderRadius: 'var(--border-radius)',
              backdropFilter: 'blur(20px)',
              background: 'rgba(255, 255, 255, 0.95)',
              boxShadow: 'var(--card-shadow)'
            }}>
              <div className="card-body p-5">
                <div className="text-center mb-4">
                  <div className="navbar-logo mb-3" style={{
                    fontSize: '2.5rem',
                    fontWeight: 'bold',
                    color: '#3b82f6',
                    display: 'inline-flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    width: '60px',
                    height: '60px',
                    borderRadius: '16px',
                    background: 'var(--primary-gradient)',
                    boxShadow: '0 8px 25px rgba(59, 130, 246, 0.3)'
                  }}>
                    EH
                  </div>
                  <h2 className="fw-bold mb-2" style={{ color: '#1e293b' }}>Welcome Back</h2>
                  <p className="text-muted">Sign in to your EventHub account</p>
                </div>

                {error && (
                  <div className="alert alert-danger animate-fade-in" style={{
                    borderRadius: 'var(--border-radius-sm)',
                    border: 'none',
                    boxShadow: '0 4px 12px rgba(239, 68, 68, 0.1)'
                  }}>
                    <i className="bi bi-exclamation-triangle-fill me-2"></i>
                    {String(error)}
                  </div>
                )}

                <form onSubmit={submit}>
                  <div className="form-group-enhanced">
                    <label className="form-label-enhanced">Username</label>
                    <div className="input-group">
                      <span className="input-group-text" style={{
                        borderRadius: 'var(--border-radius-sm) 0 0 var(--border-radius-sm)',
                        background: 'rgba(255, 255, 255, 0.8)',
                        border: '2px solid rgba(0, 0, 0, 0.08)',
                        borderRight: 'none'
                      }}>
                        <i className="bi bi-person" style={{ color: '#64748b' }}></i>
                      </span>
                      <input
                        className="form-control-enhanced"
                        style={{
                          borderRadius: '0 var(--border-radius-sm) var(--border-radius-sm) 0',
                          borderLeft: 'none'
                        }}
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                        required
                        placeholder="Enter your username"
                      />
                    </div>
                  </div>

                  <div className="form-group-enhanced">
                    <label className="form-label-enhanced">Password</label>
                    <div className="input-group">
                      <span className="input-group-text" style={{
                        borderRadius: 'var(--border-radius-sm) 0 0 var(--border-radius-sm)',
                        background: 'rgba(255, 255, 255, 0.8)',
                        border: '2px solid rgba(0, 0, 0, 0.08)',
                        borderRight: 'none'
                      }}>
                        <i className="bi bi-lock" style={{ color: '#64748b' }}></i>
                      </span>
                      <input
                        type="password"
                        className="form-control-enhanced"
                        style={{
                          borderRadius: '0 var(--border-radius-sm) var(--border-radius-sm) 0',
                          borderLeft: 'none'
                        }}
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                        placeholder="Enter your password"
                      />
                    </div>
                  </div>

                  <button
                    className="btn btn-primary w-100 py-3 btn-animated"
                    type="submit"
                    disabled={loading}
                    style={{
                      borderRadius: 'var(--border-radius-sm)',
                      fontWeight: '700',
                      background: 'var(--primary-gradient)',
                      border: 'none',
                      boxShadow: '0 8px 25px rgba(59, 130, 246, 0.3)',
                      transition: 'all 0.3s ease'
                    }}
                  >
                    {loading ? (
                      <>
                        <div className="spinner-medium" style={{ display: 'inline-block', marginRight: '0.5rem' }}>
                          <div className="spinner-ring" style={{ borderTopColor: 'white' }}></div>
                        </div>
                        Signing In...
                      </>
                    ) : (
                      <>
                        <i className="bi bi-box-arrow-in-right me-2"></i>
                        Sign In
                      </>
                    )}
                  </button>
                </form>

                <div className="text-center mt-4">
                  <p className="mb-0 text-muted">
                    Don't have an account?
                    <Link
                      to="/register"
                      className="text-decoration-none fw-semibold ms-2"
                      style={{
                        color: '#3b82f6',
                        transition: 'color 0.3s ease'
                      }}
                      onMouseEnter={(e) => e.target.style.color = '#1e40af'}
                      onMouseLeave={(e) => e.target.style.color = '#3b82f6'}
                    >
                      Sign up here
                    </Link>
                  </p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
